import React, { Component } from 'react';

import PropTypes from 'prop-types';

import './style.css';

function Header (props) {
  return (
    <div className="header">
      <div className="navbar">
        <p>Header</p>
        <p>{props.people}</p>
        <button onClick={ () => props.onClickHandle() } style={{backgroundColor: 'pink', padding: 10}}>Save</button>
      </div>
    </div>
  )
}

